const Coin = ({
    rank, name, image, current_price, price_change_percentage_24h, market_cap, volume, circulating_supply, symbol}) =>{
        return(
            <tr>
              <th scope="row">{rank}</th>
              <td><img className="mr-2" src={image} style={{height: '25px', width: '25px'}} />{name}</td>
              <td>${current_price.toLocaleString()}</td>
              <td>{price_change_percentage_24h.toFixed(3)}%</td>
              <td>${market_cap.toLocaleString()}</td>
              <td>${volume.toLocaleString()}</td>
              <td>{circulating_supply.toLocaleString()} {symbol.toUpperCase()}</td>
            </tr>
        );
    }

    export default Coin;
